package com.entity;

public class muban {
	private int mid;
	private String mname;
	private String mimg;
	private String murl;
	private int uid;
	private String uudit;
	
	public muban() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getMid() {
		return mid;
	}
	public void setMid(int mid) {
		this.mid = mid;
	}
	public String getMname() {
		return mname;
	}
	public void setMname(String mname) {
		this.mname = mname;
	}
	public String getMimg() {
		return mimg;
	}
	public void setMimg(String mimg) {
		this.mimg = mimg;
	}
	public String getMurl() {
		return murl;
	}
	public void setMurl(String murl) {
		this.murl = murl;
	}
	public int getUid() {
		return uid;
	}
	public void setUid(int uid) {
		this.uid = uid;
	}
	public String getUudit() {
		return uudit;
	}
	public void setUudit(String uudit) {
		this.uudit = uudit;
	}
	
}
